  render() {
    return (
      <div className="row">
        <Images img='https://cdn4.iconfinder.com/data/icons/logos-3/600/React.js_logo-512.png' height='300px' width='300px' />
        <Images img='https://camo.githubusercontent.com/3125421b59f34245dbc184aa00ce8491938631d3/68747470733a2f2f7265732e636c6f7564696e6172792e636f6d2f7a6569742d696e632f696d6167652f75706c6f61642f66726f6e742f6c6f676f732f6e6578742d626c61636b2e706e67' height='300px' width='300px' />
        <Images img='https://nodejs.org/static/images/logos/nodejs-new-pantone-black.png' height='300px' width='300px' />
        <Images img='https://miro.medium.com/max/1200/1*Ahl24GrglQHwFcp5-_B36Q.png' height='300px' width='300px' />
      </div>
    );
  }
}

export default Techs;
